import React from 'react'
import Sticker from '../../components/Main/Auction/Sticker'

function Auctions(){
  const stickers = []

  for(let i = 0; i < 9; i++){
    stickers.push(<Sticker index={si} />)
  }
  return(
    
    <li>
      {stickers}
    </li>

  )
}

export default Auctions
